import { Component } from "react";
import './App.css';
import useAlgo from "./useAlgo"



const App = () =>{
    var a = false;
    var b = false;
    var c = false;
    const Voila = (event) => {
      console.log(event)
      const url1 = './Food3.json'
      return useAlgo(url1)
    }
    const Pop = (event) => {
      console.log(event)
      const url2 = './popularpoll.json'
      return useAlgo(url2)
    }
    const Fresh = (event) =>{
      console.log(event)
      const url3 = './Heuristic.json'
      return useAlgo(url3)
    }
  return (
    <div>
    <button  id='btn1' onClick={event => Voila(event)}> Random </button>
    <button  id='btn2' onClick={event => Pop(event)}> Popular </button>
    <button  id='btn3'onClick={event => Fresh(event)}> Fresh </button>

    </div>
  );
}
export default App
